aal5VccEntry_t *
atm_mib_new_aal5VccEntry()
{
    aal5VccEntry_t *aal5VccEntry;

    aal5VccEntry = (aal5VccEntry_t *) g_malloc0(sizeof(aal5VccEntry_t) + sizeof(gpointer));
    return aal5VccEntry;
}

static int
unpack_aal5VccEntry(GSnmpVarBind *vb, aal5VccEntry_t *aal5VccEntry)
{
    int idx = 11;

    if (vb->id_len < idx) return -1;
    aal5VccEntry->ifIndex = vb->id[idx++];
    if (vb->id_len < idx) return -1;
    aal5VccEntry->aal5VccVpi = vb->id[idx++];
    if (vb->id_len < idx) return -1;
    aal5VccEntry->aal5VccVci = vb->id[idx++];
    if (vb->id_len > idx) return -1;
    return 0;
}

static aal5VccEntry_t *
assign_aal5VccEntry(GSList *vbl)
{
    GSList *elem;
    aal5VccEntry_t *aal5VccEntry;
    char *p;
    static guint32 const base[] = {1, 3, 6, 1, 2, 1, 37, 1, 12, 1};

    aal5VccEntry = atm_mib_new_aal5VccEntry();
    if (! aal5VccEntry) {
        return NULL;
    }

    p = (char *) aal5VccEntry + sizeof(aal5VccEntry_t);
    * (GSList **) p = vbl;

    if (unpack_aal5VccEntry((GSnmpVarBind *) vbl->data, aal5VccEntry) < 0) {
        g_warning("illegal aal5VccEntry instance identifier");
        g_free(aal5VccEntry);
        return NULL;
    }

    for (elem = vbl; elem; elem = g_slist_next(elem)) {
        GSnmpVarBind *vb = (GSnmpVarBind *) elem->data;
        if (vb->type == G_SNMP_ENDOFMIBVIEW
            || (vb->type == G_SNMP_NOSUCHOBJECT)
            || (vb->type == G_SNMP_NOSUCHINSTANCE)) {
            continue;
        }
        if (memcmp(vb->id, base, sizeof(base)) != 0) {
            continue;
        }
        if (vb->id_len > 11 && vb->id[10] == 3) {
            if (vb->type == G_SNMP_COUNTER32) {
                aal5VccEntry->aal5VccCrcErrors = &(vb->syntax.ui32[0]);
            } else {
                g_warning("illegal type for aal5VccCrcErrors");
            }
        }
        if (vb->id_len > 11 && vb->id[10] == 4) {
            if (vb->type == G_SNMP_COUNTER32) {
                aal5VccEntry->aal5VccSarTimeOuts = &(vb->syntax.ui32[0]);
            } else {
                g_warning("illegal type for aal5VccSarTimeOuts");
            }
        }
        if (vb->id_len > 11 && vb->id[10] == 5) {
            if (vb->type == G_SNMP_COUNTER32) {
                aal5VccEntry->aal5VccOverSizedSDUs = &(vb->syntax.ui32[0]);
            } else {
                g_warning("illegal type for aal5VccOverSizedSDUs");
            }
        }
    }

    return aal5VccEntry;
}

int
atm_mib_get_aal5VccTable(host_snmp *s, aal5VccEntry_t ***aal5VccEntry)
{
    GSList *in = NULL, *out = NULL;
    GSList *row;
    int i;
    static guint32 base[] = {1, 3, 6, 1, 2, 1, 37, 1, 12, 1, 0};

    *aal5VccEntry = NULL;

    base[10] = 3; stls_vbl_add_null(&in, base, 11);
    base[10] = 4; stls_vbl_add_null(&in, base, 11);
    base[10] = 5; stls_vbl_add_null(&in, base, 11);

    out = stls_snmp_gettable(s, in);
    /* stls_vbl_free(in); */
    if (! out) {
        return -2;
    }

    *aal5VccEntry = (aal5VccEntry_t **) g_malloc0((g_slist_length(out) + 1) * sizeof(aal5VccEntry_t *));
    if (! *aal5VccEntry) {
        return -4;
    }

    for (row = out, i = 0; row; row = g_slist_next(row), i++) {
        (*aal5VccEntry)[i] = assign_aal5VccEntry(row->data);
    }

    return 0;
}

